import React, {Component} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import axios from 'axios';

import logo from './img/logo.png';
import rate from './img/rate.png';
import star from './img/star.png';
import './css/addRating.css';



class addFeedback extends Component{

    constructor(props){
        super(props);
 
        
        this.onChangeOne = this.onChangeOne.bind(this);
        this.onChangeTwo = this.onChangeTwo.bind(this);
        this.onChangeThree = this.onChangeThree.bind(this);
        this.onChangeFour = this.onChangeFour.bind(this);
        this.onChangeFive = this.onChangeFive.bind(this);
        this.onChangeTotal = this.onChangeTotal.bind(this);

        //this.onSubmit = this.onSubmit.bind(this);

        this.state = {
            one: '',
            two: '',
            three:'',
            four:'',
            five:'',
            total:'',
            average:''
        }
    }

    onChangeOne(e){
        this.setState( {
            one: e.target.value
        });
    }
    onChangeTwo(e){
        this.setState( {
            two: e.target.value
        });
    }
    onChangeThree(e){
        this.setState( {
            three: e.target.value
        });
    }
    onChangeFour(e){
        this.setState( {
            four: e.target.value
        });
    }
    onChangeFive(e){
        this.setState( {
            five: e.target.value
        });
    }
    onChangeTotal(e){
        this.setState( {
            totale: e.target.value
        });
    }

    componentDidMount() {
        const x = "6449f4b078ae43e032460ac9"
        axios.get('http://localhost:4000/jacklup/rate/'+x)
            .then(res => {
                this.setState({
                    one: res.data.one,
                    two: res.data.two,
                    three: res.data.three,
                    four: res.data.four,
                    five : res.data.five,
                    total : res.data.total
                });
            })
            .catch(function (error){
                console.log("Can't Get Data");
            })
    }
  render() {
    return(
        <div>
            <div className = 'rate-content'>

                <div className='logo'>
                    <a href = "/"><img src = {logo}/></a>
                </div>
                <br/><br/><br/><br/><br/><br/><br/>
                <div className='row'>
                    <div className='col-lg-4'>
                          <img src = {rate} width="300"/>
                    </div>
                    <div className='col-lg-8'>
                        <div className='outer'>
                            <h6>What Do You Think</h6>
                            <h6>About Our Service ?</h6>
                            <br/><br/>
                            <div className='row'>
                                <div className='col-lg-4 rate-left'>
                                    <center>
                                        <img src = {star} width="100"/>
                                        <br/>
                                        <h2>{this.state.total}</h2>
                                        <h2>{this.state.average}</h2>
                                        {/* <input type = "text" value={this.state.total}/> */}
                                        <h4>Ratings</h4>
                                    </center>

                                </div>
                                <div className='col-lg-8 rate-right'>
                                    <div className='rate-right-left'>

                                    </div>
                                    <div className='rate-right-right'>
                                        
                                    </div>
                                </div>
                            </div>
                            <br/>
                            <h6>What Do You Think</h6>
                            <h6>About Our Service ?</h6>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
  }
}

export default addFeedback;
